import React from "react";
import "./App.css";
import {NavLink} from "react-router-dom";

fetch('http://localhost:8080/register', {
    method: 'POST',
    body: JSON.stringify({
        firstName: '',
        username: '',
        password: ''
    })
}).then(res => {
    return res.json()
}) 
    .then(data => console.log(data))
    .catch(error => console.log('ERROR'))

function Signup(){

    return (
        <div>
            <h1 style={{color: "white"}}>SIGNUP</h1>
            <img src="/images/Cognixia.png"/>

            <form>
                <input type="firstName" id="firstName" name="firstName" placeholder="First Name" autoComplete="off"></input><br/>
                <input type="username" id="username" name="username" placeholder="Username" autocomplete="off"></input><br/>
                <label for="password"></label>
                <input type="password" id="password" name="password" placeholder="Password" autocomplete="off"></input><br/><br/>
                <input type="submit" value="Submit" />
            </form>
        <div style={{paddingTop: "50px"}}>
            <NavLink  style={{ paddingTop: "100px", fontSize: "2.5em", color: "white", textDecoration: "underline", margin: "50px"}} exact to="/" >Home</NavLink>
        </div>
        </div>
    )
    }


export default Signup;
